Passing all kokoro tests, and jenkins failures are just timeouts due to resource constraints.

@fchollet, @martinwicke Is the API change OK?
Previously, the `_` made the tensorboard callback's `on_train_end` function require one positional arg, contraty to its superclass' definition of having one `kwarg`, `logs`. The change just makes subclass interface the same as the superclass interface.
